  const jsx = <h3>Hello JSX</h3>;

  console.log(jsx);
  return (
    <div className={title.toLowerCase()}>
      <h3>Hello {title}</h3>
      <h3>{arry}</h3>
      <h3>{hello("Hello")}</h3>
      <h3>{/* aaaa */}</h3>
      {<h3>Hello JSX</h3>}
      {jsx}
    </div>
  );
};

export default Expression;
